import { Route, Switch } from "react-router-dom";
import AllQuouts from "./pages/AllQuouts";

function App() {
  return (
    <div>
        <Switch>
            <Route path='/allQuouts' exact>
                <AllQuouts/>
            </Route>
            <Route path='/allQuouts/:quoutId' >

            </Route>
            <Route path='/addQuouts' >

            </Route>
        </Switch>
    </div>
  );
}

export default App;
